    'data:image/jpeg;base64,',

  ];

  final List<String> seriesNames = [
    'Breaking Dawn',
    'Mystery of Shadows',
    'Galactic Wars',
    'The Lost City',
    'Kingdom of Fire',
    'Enchanted Realms',
    'Ocean of Secrets',
    'Journey to the Stars',
    'Breaking Dawn',
