    'Enchanted Realms',
    'Ocean of Secrets',
    'Journey to the Stars',
    'Enchanted Realms',
    'Ocean of Secrets',
    'Journey to the Stars',

  ];

  bool _isAdVisible = true;
  List<String> filteredImageUrls = [];
  List<String> filteredSeriesNames = [];
  TextEditingController searchController = TextEditingController();

  @override
  void initState() {
    super.initState();
    _startAdTimer();
    _applyFilter('');
  }

  void _startAdTimer() {
    Timer(Duration(seconds: 10), () {
      setState(() {
        _isAdVisible = false;
      });
    });
  }

  void _applyFilter(String searchTerm) {
    setState(() {
      filteredImageUrls = [];
      filteredSeriesNames = [];
      for (int i = 0; i < seriesNames.length; i++) {
        if (seriesNames[i].toLowerCase().contains(searchTerm.toLowerCase())) {
          filteredImageUrls.add(imageUrls[i]);
          filteredSeriesNames.add(seriesNames[i]);
        }
      }
    });
  }

  void _openSeriesDetail(String imageUrl, String seriesName) {
    Navigator.push(
      context,
      MaterialPageRoute(
        builder: (context) => SeriesDetailScreen(imageUrl: imageUrl, seriesName: seriesName),
      ),
    );
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      backgroundColor: Color(0xFF1A1D24),
      appBar: AppBar(
        backgroundColor: Color(0xFF1A1D24),
        title: Text(
          'Latest',
          style: TextStyle(color: Colors.white),
        ),
      ),
      body: Column(
        children: [
          Padding(
            padding: EdgeInsets.all(8.0),
            child: TextField(
              controller: searchController,
              onChanged: (value) => _applyFilter(value),
              decoration: InputDecoration(
                hintText: 'Search by series name',
                hintStyle: TextStyle(color: Colors.white54),
                filled: true,
                fillColor: Colors.grey[800],
                border: OutlineInputBorder(
                  borderRadius: BorderRadius.circular(10.0),
                  borderSide: BorderSide.none,
                ),
                prefixIcon: Icon(Icons.search, color: Colors.white),
              ),
              style: TextStyle(color: Colors.white),
            ),
          ),
          Expanded(
            child: Stack(
              children: [
                Container(
                  padding: EdgeInsets.all(8.0),
                  child: GridView.builder(
                    gridDelegate: SliverGridDelegateWithFixedCrossAxisCount(
                      crossAxisCount: 3,
                      crossAxisSpacing: 4,
                      mainAxisSpacing: 10,
                      childAspectRatio: 300 / 350,
                    ),
                    itemCount: filteredImageUrls.length,
                    itemBuilder: (context, index) {
                      return GestureDetector(
                        onTap: () {
                          _openSeriesDetail(filteredImageUrls[index], filteredSeriesNames[index]);
                        },
                        child: Card(
                          margin: EdgeInsets.symmetric(horizontal: 6.0),
                          elevation: 4.0,
                          shape: RoundedRectangleBorder(
                            borderRadius: BorderRadius.circular(10),
                          ),
                          child: ClipRRect(
                            borderRadius: BorderRadius.circular(10),
                            child: Image.network(
                              filteredImageUrls[index],
                              width: 200,
                              height: 200,
                              fit: BoxFit.cover,
                            ),
                          ),
                        ),
                      );
                    },
                  ),
                ),
                if (_isAdVisible)
                  Positioned(
                    top: 0,
                    left: 0,
                    right: 0,
                    child: GestureDetector(
                      onTap: () {
                        print('Ad clicked!');
                      },
                      child: Image.network(
                        'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQEa_qlWW7Vr8rt1C5UeRngmPGBuix12tRmDg&s',
                        width: double.infinity,
                        height: 400,
                        fit: BoxFit.cover,
                      ),
                    ),
                  ),
              ],
            ),
          ),
        ],
      ),
    );
  }
